var $bm_rt;
var n, n, t, t, v, amp, freq, decay, M;
$bm_rt = n = 0;
if (numKeys > 0) {
    $bm_rt = n = nearestKey(time).index;
    if (key(n).time > time) {
        n--;
    }
}
if (n == 0) {
    $bm_rt = t = 0;
} else {
    $bm_rt = t = $bm_sub(time, key(n).time);
}
if (n > 0) {
    v = velocityAtTime($bm_sub(key(n).time, $bm_div(thisComp.frameDuration, 10)));
    amp = 2;
    freq = 2;
    decay = 8;
    M = $bm_div(Math.sin($bm_mul($bm_mul($bm_mul(freq, t), 2), Math.PI)), Math.exp($bm_mul(decay, t)));
    $bm_rt = $bm_sum(value, $bm_mul($bm_mul(v, amp), M));
} else {
    $bm_rt = value;
}

